def aa_transfer(string) : 
    list_string = [string[i : i + 3] for i in range(0, len(string), 3)]
    AA_list = []
    for j in list_string : 
        AA_list.append(AA_dic[j])
    aa_code = ''.join(AA_list)
    
    return aa_code

string = ''
aa_transfer(string)
